12:"created_time";i:1599264980;}i:55;a:1:{s:7:"caption";s:1031:"Did you know that there are different types of sunscreen?

Sunblock acts as a physical barrier between the sun and your skin. It contains minerals ‚Äî such as zinc oxide or titanium dioxide ‚Äî that act as UV filters by reflecting the sun‚Äôs harmful rays before they are able to penetrate the layers of our skin

Sunscreen uses chemical sun protection that prevents skin damage by absorbing harmful UV radiation. Organic compounds in chemical sunscreens are actually absorbed into the skin rather than sitting on top of it to act as effective UV filters
For sunscreen to be considered broad-spectrum it must contain ingredients that protect users from both UVA and UVB rays. Thus, broad-spectrum formulas usually contain both physical and chemical sun protection ingredients
